            <h1>Pete Potipitak</h1>
          </motion.div>
        </div>
      </div>
      <div className={`bg-primary ${styles.paddingX} ${styles.flexStart}`}>
        <div className={`${styles.boxWidth}`}>

        </div>
      </div>
    </>
  )
}

export default Hero
